const CreatePage = () => {
  return (
  <main className="mw">
      <h2>새글 등록 </h2>
      <form>
        <label htmlFor="title">제목</label>
        <input type="text" name="title"></input>
      </form>
  </main>
  )
};
export default CreatePage;
